import React from "react";
import "./MangasList.css";

const MangasList = () => {
  return (
    <div>
      <main>
        <div className="first-row">
          <div className="one">
            <div className="manga_cover">
              <img src="../../img/shuumatsu_no_valkyrie.png" alt="manga" />{" "}
            </div>
            <div className="disc">
              <h4>shuumatsu no valkyrie</h4>
              <p>
                Every 1000 years, gods of every pantheon convene and hold a
                conference to decide the fate of humanity by calling a vote to
                determine whether or not the human race should continue living
                or go extinct <a href="#">read more</a>
              </p>
              <button className="yelow ish">
                <i className="fas fa-eye" />
                watch now
              </button>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default MangasList;
